# Lesson 11: Buzzer and Ultrasonic
## 11.1 Overview
This lesson combines two lessons, lesson 9, Buzzer, and lesson 5, Ultrasonic
HC-SR04+, and you will learn how to trigger a buzzer depending on distance.

## 11.2 Components required
* Development board;
* Breadboard 830p;
* Ultrasonic module HC-SR04+;
* 1 x passive buzzer;
* Diode;
* Transistor;
* 1 x 1000 Ω resistor ;
* 11 x male-to-male jumper wires;
* Micro USB – Type A USB cable;


